import React from 'react';

import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';

const Navbar = props => {
	return (
		<Grid item container direction='row-reverse' justify='space-between'>
			<Grid
				item
				container
				xs={5}
				spacing={3}
				direction='row-reverse'
				className='navbar-items'
				style={{ marginTop: 15 }}
			>
				<Grid item>
					<p>لوگو - تیزتایپ</p>
				</Grid>
				<Grid item>
					<p>چرا تیزتایپ؟</p>
				</Grid>
				<Grid item>
					<p>تعرفه‌ها</p>
				</Grid>
				<Grid item>
					<p>چطوری کار میکنه؟</p>
				</Grid>
			</Grid>
			<Grid item container xs={2} alignItems='center' spacing={2} style={{ marginTop: 15 }}>
				<Grid item>
					<Button variant='contained' color='primary' size='large' style={{ borderRadius: 50 }}>
						<span style={{ fontSize: '1.2em' }}>ورود</span>
					</Button>
				</Grid>
				<Grid item className='navbar-item'>
					<p>ثبت‌نام</p>
				</Grid>
			</Grid>
		</Grid>
	);
};

export default Navbar;
